import React from 'react';
import NavigationButton from './NavMenu';

const Home = () => {
  return (
    <div>
      <h1 style={{ textAlign: 'left' }}>MUSEUM OF PHOTOGRAPHY</h1>
      <hr />
      <div>
        <h2>Exhibit name</h2>
        <p>Short description</p>
      </div>
      <img src="path_to_your_image" alt="Exhibit" />
      <div style={{ display: 'flex', justifyContent: 'center', marginTop: '20px' }}>
        <button style={{ marginRight: '10px' }}>Button 1</button>
        <button>Button 2</button>
      </div>
      <NavigationButton />
    </div>
  );
};

export default Home;
